export default function Layout({ Children }) {
  const username = useContext(UserContext);
  return (
    <div className="grid grid-col-1 md:grid-cols-5">
      <div className="col-span-1 md:col-span-5">
        <NavBar />
      </div>
      <div className="m-10">
        <h1>Hello {username}</h1>
      </div>
    </div>
  );
}
